"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["7963"],{35781:function(e){e.exports=JSON.parse('{"name":"GitHub Comment","slug":"github-comment","url":"https://github.com/yyewolf/woodpecker-plugins/tree/main/github-comment","icon":"https://github.githubassets.com/images/modules/logos_page/GitHub-Mark.png","description":"Create or update comments on GitHub pull requests","docs":"<h1>plugin-github-comment</h1>\\n<p>Woodpecker plugin to create or update comments on GitHub pull requests. Perfect for posting automated feedback, build status, test results, and other CI/CD notifications directly to your pull requests.</p>\\n<p>To update comments in place (instead of creating new comments each time), use the <code>message_id</code> setting to uniquely identify your comment. This allows for cleaner PR discussions by keeping related updates together. Behind the scenes, the plugin uses this ID and puts it in a hidden footer to track and update the comment, if the ID is not unique, you may end up updating the wrong comment.</p>\\n<p>The plugin is built for the following platforms:</p>\\n<ul>\\n<li>linux/386</li>\\n<li>linux/amd64</li>\\n<li>linux/arm</li>\\n<li>linux/arm64</li>\\n<li>linux/loong64</li>\\n<li>linux/mips</li>\\n<li>linux/mips64</li>\\n<li>linux/mips64le</li>\\n<li>linux/mipsle</li>\\n<li>linux/ppc64</li>\\n<li>linux/ppc64le</li>\\n<li>linux/riscv64</li>\\n<li>linux/s390x</li>\\n</ul>\\n<h2>Features</h2>\\n<ul>\\n<li>Create new comments on pull requests</li>\\n<li>Update existing comments in place using message IDs</li>\\n<li>Support for both inline comments and comment files</li>\\n<li>Automatic timestamp and attribution footer</li>\\n<li>Flexible repository and PR targeting</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>github_token</code></td>\\n<td><em>none</em></td>\\n<td>GitHub personal access token or App token. Either this or <code>github_token_path</code> is required</td>\\n</tr>\\n<tr>\\n<td><code>github_token_path</code></td>\\n<td><em>none</em></td>\\n<td>Path to file containing GitHub token. Either this or <code>github_token</code> is required</td>\\n</tr>\\n<tr>\\n<td><code>comment</code></td>\\n<td><em>none</em></td>\\n<td>Comment text (supports Markdown). Either this or <code>comment_path</code> is required</td>\\n</tr>\\n<tr>\\n<td><code>comment_path</code></td>\\n<td><em>none</em></td>\\n<td>Path to file containing comment text. Either this or <code>comment</code> is required</td>\\n</tr>\\n<tr>\\n<td><code>message_id</code></td>\\n<td><em>none</em></td>\\n<td>Unique identifier for the comment. Required when <code>update_in_place</code> is true</td>\\n</tr>\\n<tr>\\n<td><code>update_in_place</code></td>\\n<td><code>false</code></td>\\n<td>If true, updates existing comment with same <code>message_id</code> instead of creating new one</td>\\n</tr>\\n<tr>\\n<td><code>repo</code></td>\\n<td><em>CI_REPO</em></td>\\n<td>Repository in format <code>owner/repo</code>. Defaults to current repository</td>\\n</tr>\\n<tr>\\n<td><code>pull_request</code></td>\\n<td><em>CI_COMMIT_PULL_REQUEST</em></td>\\n<td>Pull request number. Defaults to current PR</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<h3>Basic comment on current PR:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  comment:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: |\\n        ## Build Status\\n        \u2705 Build completed successfully!\\n        \\n        - Tests: All passed\\n        - Coverage: 85%\\n        - Duration: 2m 34s\\n</code></pre>\\n<h3>Update comment in place:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  update-status:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: |\\n        ## \u{1F504} Build In Progress\\n        \\n        Current step: Running tests...\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n\\n  final-status:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: |\\n        ## \u2705 Build Complete\\n        \\n        All tests passed successfully!\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n</code></pre>\\n<h3>Comment from file:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  test-results:\\n    image: your-test-runner\\n    commands:\\n      - run-tests &gt; test-results.md\\n\\n  comment-results:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment_path: test-results.md\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n</code></pre>\\n<h3>Comment on different repository:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  cross-repo-comment:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      repo: owner/other-repo\\n      pull_request: 42\\n      comment: |\\n        ## Deployment Status\\n        \\n        This change has been deployed to staging environment.\\n        \\n        \u{1F517} [View deployment](https://staging.example.com)\\n</code></pre>\\n<h3>Multiple notification strategy:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  start-notification:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: \\"\u{1F680} Starting build process...\\"\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n\\n  update-progress:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: \\"\u26A1 Running tests and building artifacts...\\"\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n\\n  final-result:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token:\\n        from_secret: github_token\\n      comment: |\\n        ## \u2705 Build Complete\\n        \\n        - \u2705 Tests passed\\n        - \u2705 Build successful  \\n        - \u2705 Artifacts generated\\n        \\n        Ready for review! \u{1F389}\\n      message_id: uniquely-identifiable-message-id\\n      update_in_place: true\\n</code></pre>\\n<h2>Comment Format</h2>\\n<p>All comments include an automatic footer with:</p>\\n<ul>\\n<li>Message ID (if provided)</li>\\n<li>Timestamp</li>\\n<li>Attribution to the plugin</li>\\n</ul>\\n<p>Example footer:</p>\\n<pre><code class=\\"language-html\\">&lt;details&gt;&lt;summary&gt;Details&lt;/summary&gt;\\n&lt;p&gt;\\n&lt;sub&gt;\\nMessageID: #uniquely-identifiable-message-id&lt;br&gt;\\nDate: 2025-10-22T14:30:00Z&lt;br&gt;\\nBy &lt;a href=\\"https://github.com/yyewolf/woodpecker-plugins/github-comment\\"&gt;yyewolf/woodpecker-plugins/github-comment&lt;/a&gt;&lt;br&gt;\\n&lt;/p&gt;\\n&lt;/details&gt;\\n</code></pre>\\n<h2>Authentication</h2>\\n<p>The plugin supports multiple authentication methods:</p>\\n<ol>\\n<li><strong>Personal Access Token</strong>: Create a classic token with <code>repo</code> scope</li>\\n<li><strong>GitHub App Token</strong>: Use with the <code>github-app-token</code> plugin for enhanced security</li>\\n<li><strong>Fine-grained Personal Access Token</strong>: For repository-specific access</li>\\n</ol>\\n<h3>Using with GitHub App Token plugin:</h3>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  get-token:\\n    image: yyewolf/woodpecker-plugin-github-app-token\\n    settings:\\n      github_app_id:\\n        from_secret: github_app_id\\n      github_installation_id:\\n        from_secret: github_installation_id\\n      github_private_key_pem:\\n        from_secret: github_private_key_pem\\n\\n  comment:\\n    image: ghcr.io/yyewolf/woodpecker-plugins/github-comment\\n    settings:\\n      github_token_path: .github_token\\n      comment: \\"Build completed with GitHub App authentication!\\"\\n</code></pre>\\n<h2>Error Handling</h2>\\n<p>The plugin will fail with descriptive error messages if:</p>\\n<ul>\\n<li>Required authentication is missing</li>\\n<li>Comment content is not provided</li>\\n<li>Target repository or PR cannot be found</li>\\n<li>GitHub API returns an error</li>\\n<li><code>update_in_place</code> is true but <code>message_id</code> is not provided</li>\\n</ul>\\n<h2>Best Practices</h2>\\n<ol>\\n<li><strong>Use message IDs</strong>: Always use <code>message_id</code> for status updates to avoid comment spam</li>\\n<li><strong>Update in place</strong>: Set <code>update_in_place: true</code> for progress updates</li>\\n<li><strong>Secure tokens</strong>: Store GitHub tokens as Woodpecker secrets</li>\\n<li><strong>Rich formatting</strong>: Use Markdown for better-formatted comments</li>\\n<li><strong>Conditional comments</strong>: Use Woodpecker\'s conditional execution for relevant comments only</li>\\n</ol>\\n","tags":["github","comment","pull-request","automation"],"author":"yyewolf","containerImage":"ghcr.io/yyewolf/woodpecker-plugins/github-comment","containerImageUrl":"https://github.com/yyewolf/woodpecker-plugins/pkgs/container/woodpecker-plugins%2Fgithub-comment","verified":false,"iconDataUrl":"data:image/png;base64,"}')}}]);